import { StyleSheet} from 'react-native'
const styles = StyleSheet.create({
    backButton:{
        marginLeft:10
    },
    title:{
        fontSize:28,
        fontWeight:'bold',
        color: "#127cc0",
    },
    subTitle:{
        fontSize:16,
        color:'black',
        padding: 10,
    },
    innerContainer:{
        alignItems:'center',
        marginVertical:40,
    },
    input:{
        backgroundColor:"#abdcf5" ,
         margin:20,
    },
    button:{
        backgroundColor:"#127cc0",
        margin: 20,
        alignItems:'center',
        borderRadius:50,
    },
    buttonText:{
        fontSize:20,
        marginVertical:10,
        color:'white',

    },
    radio:{
        alignItems:'center',
        flexDirection:'row',
        marginLeft:20,
    },
});
export default styles
